import React from "react";
import { styled } from "styled-components";

const Div = styled.div`
  background-color: #fff;
  padding: 15px 10px;
`;
export default function FormInput() {
  return (
    <div>
      <input type="text" />
      <input type="date" />
      <input type="text" />
    </div>
  );
}
